CREATE TABLE pokemon_forms (
    id INT PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    order_ INT,
    form_name VARCHAR(30) NOT NULL,
    is_default BOOLEAN,
    is_battle_only BOOLEAN,
    is_mega BOOLEAN,
    version_group_id INT,
    pokemon_id INT,
    form_order INT,
    FOREIGN KEY (version_group_id) REFERENCES versions_groups(id) ON DELETE RESTRICT ON UPDATE CASCADE,
    FOREIGN KEY (pokemon_id) REFERENCES pokemon(id) ON DELETE RESTRICT ON UPDATE CASCADE
);


